import React, { useState } from "react";

function App() {
const [count, setCount] = useState(123);

function increase() {
  setCount(12)
}

  return (
    <div className="container">
      <h1>{count}</h1>
      <button onClick={increase}>+</button>
    </div>
  );
}

export default App;
